	add("purdah", "{\"term\":\"purdah\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Persian\", \"Hindi\", \"Urdu\"], \"text\":\"From Hindi \u0027पर्दा\u0027 Urdu \u0027پردہ\u0027 from Persian \u0027پرده\u0027 (curtain)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A curtain, especially as used to conceal and divide women from men and strangers in some Hindu or Muslim traditions\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1888\u0027\u0027, Rudyard Kipling, ‘A Wayside Comedy’, \u0027Under the Deodars\u0027, Folio Society 2005, p. 34\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"As she passed through the dining-room, she heard, behind the \u0027\u0027\u0027purdah\u0027\u0027\u0027 that cloaked the drawing-room door, her husband\u0027s voice\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A striped cotton cloth which is used to make curtains\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A long veil, or other all-enveloping clothing, worn by women in some Muslim societies\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The state or system of social gender seclusion in some Muslim or Hindu communities\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The time between the announcement and holding of an election, during which any governmental activities that may be construed as potentially benefiting or promoting a specific political party or prospective candidate are halted or suspended\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The period after plans have been prepared but before the Chancellor of the Exchequer\u0027s annual budget is announced, when he refrains from discussing any matters which have relevance to the forthcoming budget\", \"priority\":8}]}, \"synonyms\":{}}");

