	add("purga", "{\"term\":\"purga\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Finnish\", \"Russian\"], \"text\":\"From Russian \u0027пурга́\u0027 probably from \u0027purku\u0027 Finnish \u0027purku\u0027 (snowstorm)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A fine blizzard of snow in Russia\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, James Meek, \u0027The People\u0027s Act of Love\u0027, Canongate 2006, p. 191\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"When the black \u0027\u0027purga\u0027\u0027 blows it can pile the snow higher than a ship\u0027s mast overnight\", \"priority\":3}]}, \"synonyms\":{}}");

	add("purge", "{\"term\":\"purge\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) \u0027purgen\u0027 from Old french (842-ca. 1400) \u0027purgier\u0027 from Latin \u0027purgō\u0027 (i make pure, i cleanse) from \u0027purus\u0027 () + {{m|la|agō||I make, I do}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An act of purg\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"purging\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An evacuation of the bowels or a vomiting\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A cleansing of pipes\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A forcible removal of people, for example, from political activity\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Stalin liked to ensure that his \u0027\u0027purges\u0027\u0027 were not reversible\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"That which purges; especially, a medicine that evacuates the intestines; a cathartic\", \"priority\":7}]}, \"synonyms\":{}}");

