	add("purine", "{\"term\":\"purine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of a class of organic heterocyclic compounds composed of fused pyrimidine and imidazole rings that comprise one of the two groups of organic nitrogenous bases (the other being the pyrimidines) and are components of nucleic acids\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1982\u0027\u0027, Ray A. Field, \u0027Mechanically Deboned Red Meat\u0027, C. O. Chichester, George Franklin Stewart, \u0027Advances in Food Research\u0027, Volume 27, [http://books.google.com.au/books?id\u003d1OxTMV3ScDkC\u0026amp;pg\u003dPA67\u0026amp;dq\u003d%22purine%22%7C%22purines%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dgMcBU_6yCs3RkQWm_4GACA\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22purine%22%7C%22purines%22\u0026amp;f\u003dfalse page 67\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Clifford \u0027et al.\u0027 (1976) investigated the metabolism of individual \u0027\u0027purines\u0027\u0027 and found that adenine, and to a lesser extent hypoxanthine, had pronounced effects on blood uric acid levels. The \u0027\u0027purine\u0027\u0027 content of foods, in particular adenine, would therefore be of immense nutritional significance\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1993\u0027\u0027, Andrew Travers, \u0027DNA-Protein Interactions\u0027, [http://books.google.com.au/books?id\u003d17xyknkbAikC\u0026amp;pg\u003dPA6\u0026amp;dq\u003d%22purine%22%7C%22purines%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dgMcBU_6yCs3RkQWm_4GACA\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22purine%22%7C%22purines%22\u0026amp;f\u003dfalse page 6\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"For example, for \u0027\u0027purine\u0027\u0027-pyrimidine and for pyrimidine-\u0027\u0027purine\u0027\u0027 base steps the presence of \u0027\u0027purines\u0027\u0027 on opposite strands in successive base pairs sterically restricts the conformations that these base pairs can adopt relative to each other\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Hemanta K. Majumder, \u0027Drug Targets in Kinetoplastid Parasites\u0027, [http://books.google.com.au/books?id\u003drk9H6xW6Z10C\u0026amp;pg\u003dPA142\u0026amp;dq\u003d%22purine%22%7C%22purines%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dgMcBU_6yCs3RkQWm_4GACA\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22purine%22%7C%22purines%22\u0026amp;f\u003dfalse page 142\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The discovery that certain pyrazolopyrimidine nucleobases and nucleosides, analogs of naturally occurring \u0027\u0027purines\u0027\u0027, are toxic to \u0027Leishmania\u0027, coupled with the obligatory nature of the leishmanial \u0027\u0027purine\u0027\u0027 salvage pathway, has spawned considerable interest in the \u0027\u0027purine\u0027\u0027 salvage pathway as a drug target\", \"priority\":10}]}, \"synonyms\":{}}");

