	add("purse", "{\"term\":\"purse\", \"etymology\":{\"influencers\":[{},{},{},{}], \"languages\":[\"old english (ca. 450-1100)\", \"Danish\", \"English\", \"middle english (1100-1500)\", \"French\", \"old french (842-ca. 1400)\", \"old high german (ca. 750-1050)\", \"ancient greek (to 1453)\", \"low german\", \"old norse\", \"old saxon\"], \"text\":\"From Middle english (1100-1500) from Old english (ca. 450-1100) \u0027purs\u0027 (purse) partly from Old english (ca. 450-1100) \u0027pusa\u0027 (wallet, bag, scrip) and partly from Old english (ca. 450-1100) \u0027burse\u0027 (pouch, bag) Old english (ca. 450-1100) \u0027pusa\u0027 comes from Proto-germanic {{m|gem-pro|*pusô||bag, sack, scrip}}, from Proto-indo-european {{m|ine-pro|*būs-||to swell, stuff}}, and is cognate with Old high german (ca. 750-1050) \u0027pfoso\u0027 (pouch, purse) Low german \u0027puse\u0027 Old norse \u0027posi\u0027 (purse, bag) Danish \u0027pose\u0027 (purse, bag) Old english (ca. 450-1100) \u0027burse\u0027 comes from \u0027bursa\u0027 (leather bag) (compare English \u0027bursar\u0027 , from Ancient greek (to 1453) \u0027βύρσα\u0027 (hide, wine-skin) Compare also Old french (842-ca. 1400) \u0027borse\u0027 (French \u0027bourse\u0027 , Old saxon \u0027bursa\u0027 (bag) Old high german (ca. 750-1050) \u0027burissa\u0027 (wallet)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small bag for carrying money\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1550\u0027\u0027 Mierdman, Steuen, \u0027The market or fayre of usurers\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"And then muſt many a man occupie as farre as his \u0027\u0027purſe\u0027\u0027 would reache, and ſtretche out his legges accordynge to the length of his couerlet\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A handbag (small bag usually used by women for carrying various small personal items\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A quantity of money given for a particular purpose\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Episode 12, \u0027The Cyclops\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"It was a historic and a hefty battle when Myler and Percy were scheduled to don the gloves for the \u0027\u0027purse\u0027\u0027 of fifty sovereigns\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A specific sum of money in certain countries: formerly 500 piastres in Turkey or 50 tomans in Persia\", \"priority\":8}]}, \"synonyms\":{}}");

